import React,{Component} from "react";
 class File extends Component{
    method(){
        return <span>Programmer</span>
    }
    render(){
        const name = "Mohammed Khalifah"
        const jop = this.method();
        return(
            <div>
                <h1>{name}</h1>
                {jop}
            </div>

        )
    }
 }
 export default File;
